import { useState } from "react";



const Home = () => {

    const [age, setAge] = useState(1)

    const handleClick = () => {
        console.log(age)
        setAge(age + 1)
    }


    return ( 
        <div className="home">
        <h2>home page {age}</h2>
        <button onClick={handleClick}>Click me!</button>
        </div>
     );
}
 
export default Home;
